import {FaShoppingCart} from "react-icons/fa"
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return(
    <div>
      <div className="flex flex-row justify-between">
      <NavLink>
        <div>
          <img src=""/>
        </div>
      </NavLink>
      
        <div>
        <NavLink>
          <p>Home</p>
        </NavLink>

        <NavLink>
          <div>
            <FaShoppingCart/>
          </div>
        </NavLink>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
